$(document).ready(function(){var t=$(".address").text().trim().length;t<12&&$(".addrs-text").text("Click here to load full address!"),$(".address").click(function(e){if(t<12){let t=new URLSearchParams(window.location.search);if(t.has("pid")){var d={pid:t.get("pid")};$.get("/trigger",d,function(t){$(".addrs-text").html(t)})}e.preventDefault()}})});